# day 5, part 1
# reduce a long string by finding neighboring characters of opposite upper/lower
# scan the string, looking for an .isupper and .islower of the same character
# remove it from the string if found
# output is the length of the resulting string

import string
def getReducedPolymerLength( p ):
  i = 0
  while True:
    # if cur is same letter as next and cur case XOR next case ...
    if (p[i].lower() == p[i+1].lower()) and (p[i].isupper() != p[i+1].isupper()):
      # remove the two chars
      if i+3 > len(p):
        p = p[:i]
      else:
        p = p[:i] + p[i+2:]

      # now step back to prev
      i -= 1
      if i < 0:
        i = 0
    else:
      # advance to next
      i += 1
      if i > len(p) - 3:
        # we're done
        return len(p)

# input polymer
p = ''
#'
#p = 'dabAcCaCBAcCcaDA' # sample input

print( getReducedPolymerLength( p ) )

